import "./MobileTest.css";

function MobileTest() {
  return (
    <div className="MParent">
      <div className="FriendsList">
        <div className="AddFriend">
          <input type="text"></input>
        </div>
      </div>
      <div className="Chat"></div>
    </div>
  );
}

export default MobileTest;
